                        	<!-- s: isi berita -->
                            <div class="kcm-read-text">
                                <p><strong>JAKARTA, KOMPAS.com</strong>&nbsp;—&nbsp;Pengelolaan parkir oleh Pemerintah Provinsi (Pemprov) DKI Jakarta di Taman Ismail Marzuki (TIM), Menteng, Jakarta Pusat, dinilai cukup baik. Hal ini terlihat dari pendapatan retribusi parkir di lokasi yang naik signifikan.<br><br>"Dulu waktu dikelola swasta sebulannya Rp 47 juta, tetapi saat kita ambil alih, baru empat hari saja sudah lebih dari <em>segitu</em>," ujar Andri Yansyah, Kepala Dinas Perhubungan dan Transportasi DKI Jakarta, Kamis (12/5/2016).<br><br>Menurut Andri, pihaknya akan terus menjajaki lokasi lain yang parkirnya dikelola swasta untuk diambil alih pengelolaannya. Dengan demikian, retribusi dari tempat parkir tersebut bisa menambah ‎pendapatan daerah.<br><br>"Kita kan juga diminta kelola parkiran RSUD, pasar, dan kantor wali kota. Semuanya akan dikelola secara bertahap," ujarnya.</p>
<p>Pengelolaan parkir di TIM sebelumnya dipegang oleh PT Putraja, yang disebut sebagai salah satu perusahaan milik Wakil Ketua DPRD DKI <a href="http://megapolitan.kompas.com/tag/Abraham%20Lunggana?utm_source=RD&amp;utm_medium=inart&amp;utm_campaign=khiprd" style="color:#428bca;">Abraham Lunggana</a> alias Lulung. Pemprov DKI tidak memperpanjang kontrak perusahaan itu lantaran banyak laporan masyarakat soal pungutan liar.</p>
<p>"Ada laporan masyarakat ke Pemprov soal pungutan ganda. Jadi, pungutan yang dilakukan Putraja itu pertama di pintu masuk sudah dipungut. Kemudian, di tengah, konon katanya, saya juga belum pernah dapat, disinyalir mereka dipungut lagi," kata staf Humas UPT Perparkiran Dishubtrans DKI, Ivan Valentino, saat dihubungi <em>Kompas.com</em> di Jakarta, Senin (2/5/2016).</p>
<p>Berdasarkan perintah Gubernur DKI Jakarta <a style="color: #428bca;" href="http://megapolitan.kompas.com/tag/Basuki%20Tjahaja%20Purnama?utm_source=RD&amp;utm_medium=inart&amp;utm_campaign=khiprd"></a><a href="http://megapolitan.kompas.com/tag/Basuki%20Tjahaja%20Purnama?utm_source=RD&amp;utm_medium=inart&amp;utm_campaign=khiprd" style="color:#428bca;">Basuki Tjahaja Purnama</a> atau Ahok, Pemprov DKI Jakarta mengambil alih pengelolaan parkir di TIM dari PT Putraja.</p>
<p>Perusahaan swasta itu sendiri sudah mengelola parkir TIM sejak tahun 2005 dan kontraknya berakhir pada 31 Maret 2016.</p>
<p></p><div id="627853" class="photo" style="   max-width: 100% ; width:780px "><img data-width="780px" data-aligment="" src="./Dulu Pendapatan Parkir TIM Rp 47 Juta Sebulan, Sekarang Rp 47 Juta Hanya 4 Hari - Kompas.com_files/1952149IMG-20160503-185013780x390.jpg" alt=""><span class="pb_10 author">Nibras Nada Nailufar</span> Kantor PT Putraja Perkasa yang terletak satu ruko dengan Kantor Advokat H. Lulung, Frendik, dan Rekan.<div class="media-action-overlay" style="opacity: 0;"><i class="icon icon-zoom-in colorbox cboxElement" href="http://assets.kompas.com/data/photo/2016/05/03/1952149IMG-20160503-185013780x390.jpg" rel="colorbox"></i></div></div>Menurut Ivan, berdasarkan laporan masyarakat, pungutan liar itu besarannya Rp 5.000 hingga Rp 10.000.<p></p>
<p>Pengambilalihan pengelolaan parkir itu mulai efektif pada 1 Mei 2016. Setelah diambil alih, proses parkir di TIM jadi lebih sistematis. Di pintu masuk, fungsi petugas tiket digantikan mesin. Sementara itu, di pintu keluar, ada penjagaan oleh pegawai Dishub DKI Jakarta, baik di loket motor maupun mobil.</p>
<p>Dishubtrans menerapkan tarif parkir sesuai dengan Pergub 179 Tahun 2013 tentang Tarif Pelayanan Parkir. Untuk mobil, satu jam pertama adalah Rp 4.000. Setiap jam berikutnya Rp 2.000. Tarif untuk sepeda motor adalah Rp 2.000 untuk satu jam pertama dan Rp 1.000 untuk setiap jam selanjutnya. Sementara itu, tarif parkir bus atau truk Rp 6.000 untuk satu jam pertama dan Rp 3.000 untuk setiap jam selanjutnya.</p>
<p>&nbsp;</p>
